void EventDispatch(API_Event_t* pEvent)
{
    switch(pEvent->id)
    {
		case API_EVENT_ID_SIGNAL_QUALITY:
		  
		  
		    
			
if(((pEvent->param1)*2-113)>-80)
	callok=true;
else 
	callok=false;
		
			break;
			
			
		case API_EVENT_ID_NETWORK_ATTACHED:
            Trace(2,"network attach success");
            Network_PDP_Context_t context = {
                .apn        ="internet",
                .userName   = ""    ,
                .userPasswd = ""
            };
            Network_StartActive(context);
			 
             break;
		
        case API_EVENT_ID_POWER_INFO:

          	
           
            if( ((pEvent->param1)>>16)==1 && lvgl_init_flag && !ischarging )
			{
				
				if(!ischarging){
					
					
					dowork=false;
					OS_Sleep(300);
					ST7789_Close();
					 
					setAddrWindow(0,0,239,239);
					OS_Sleep(300);
					 
					dowork=true;
					OS_Sleep(100);
			 
					
					/*
					 
					writecommand(ST7789_DISPOFF);
					OS_Sleep(1000);
					writecommand(ST7789_DISPON);*/
					//PM_Restart();
					 
					//OS_Sleep(100);
					//setAddrWindow(0,0,240,240);
					//OS_Sleep(100);
					//dowork=true;
				}
					ischarging=true;
            	 
			}
            else if(((pEvent->param1)>>16)==0)
			{
				if(ischarging){
				 
					dowork=false;
					
					OS_Sleep(300);
					ST7789_Close();
					 
					setAddrWindow(0,0,239,239);
					OS_Sleep(300);
					dowork=true;
					OS_Sleep(100);
					 /*
					writecommand(ST7789_DISPOFF);
					OS_Sleep(1000);
					writecommand(ST7789_DISPON);*/
			  
					//OS_Sleep(100);
					//setAddrWindow(0,0,240,240);
					//OS_Sleep(100);
					dowork=true;
				}
           		ischarging=false; 

			}				
 Trace(3,"charge started %d",((pEvent->param1)));
          
           
            break;
        case API_EVENT_ID_SYSTEM_READY:
            break;
        default:
            break;
    }
}


