void AppMainTask(void *pData)
{
    API_Event_t* event=NULL;
    OS_Sleep(3000);
            
    OS_CreateTask(LVGL_Task ,
        NULL, NULL, AppMain_TASK_STACK_SIZE, AppMain_TASK_PRIORITY+1, 0, 0, "lvgl Task");
    OS_CreateTask(Display_Task ,
        NULL, NULL, AppMain_TASK_STACK_SIZE, AppMain_TASK_PRIORITY+2, 0, 0, "display Task");
    while(1)
    {
        if(OS_WaitEvent(mainTaskHandle, (void**)&event, OS_TIME_OUT_WAIT_FOREVER))
        {
            EventDispatch(event);
            OS_Free(event->pParam1);
            OS_Free(event->pParam2);
            OS_Free(event);
        }
    }
}
void lvglslow_Main(void)
{
    mainTaskHandle = OS_CreateTask(AppMainTask ,
        NULL, NULL, AppMain_TASK_STACK_SIZE, AppMain_TASK_PRIORITY, 0, 0, "init Task");
    OS_SetUserMainHandle(&mainTaskHandle);
}

void clock_handle(void* param)
{
	
 	     
		
		TIME_System_t localTime;
    TIME_GetLocalTime(&localTime);

      
 char st[6];
 sprintf(st,"%02d:%02d",localTime.hour,localTime.minute);

    lv_label_set_text(param,st);
    lv_obj_realign(param);

}

void battery_handle(void* par)
{



uint8_t percent;
uint16_t volt= PM_Voltage(&percent);


char* symbol;
symbol=SYMBOL_BATTERY_EMPTY;
if (percent<=20)symbol=SYMBOL_BATTERY_EMPTY;
else if(percent<=40)symbol=SYMBOL_BATTERY_1;
else if(percent<=60)symbol=SYMBOL_BATTERY_2;
else if(percent<=80)symbol=SYMBOL_BATTERY_3;
else if(percent<=100)symbol=SYMBOL_BATTERY_FULL;
 lv_obj_t* val=((lv_obj_t **)par)[1];
 lv_obj_t* val1=((lv_obj_t **)par)[0];
 lv_obj_t* val2=((lv_obj_t **)par)[2];
    
    lv_label_set_text(val,symbol);
    lv_obj_realign(val);

  if(ischarging)
  {
  	  
    

    lv_label_set_text(val1,SYMBOL_CHARGE);
    lv_obj_realign(val1);
   
  }
  else
  {

  	 lv_label_set_text(val1,"");
    lv_obj_realign(val1);


  }
  Trace(2,"callok %d",callok);

  if(callok)
  {
  	  
    

    lv_label_set_text(val2,SYMBOL_CALL);
    lv_obj_realign(val2);
   
  }
  else
  {

  	 lv_label_set_text(val2,"");
    lv_obj_realign(val2);


  }
  
  


}


/* Flush the content of the internal buffer the specific area on the display
 * You can use DMA or any hardware acceleration to do this operation in the background but
 * 'lv_flush_ready()' has to be called when finished
 * This function is required only when LV_VDB_SIZE != 0 in lv_conf.h*/
static void ex_disp_flush(int32_t x1, int32_t y1, int32_t x2, int32_t y2, const lv_color_t * color_p)
{
    /*The most simple case (but also the slowest) to put all pixels to the screen one-by-one*/

	     Trace(3,"ex_disp_flush %d,%d %d,%d",x1,y1,x2,y2);

   
   
   
    for(uint16_t y = y1; y <= y2; y++) {
        for(uint16_t x = x1; x <= x2; x++) {
     
		
		oled_buffer[((y*240)+x)*2]=(color_p->full)>>8;
		oled_buffer[(((y*240)+x)*2)+1]=color_p->full;
             color_p++;
			 
        }
    }
	
	
	
while(!dowork);


  scan();
  
    
  lv_flush_ready();
   
    
}


/* Write a pixel array (called 'map') to the a specific area on the display
 * This function is required only when LV_VDB_SIZE == 0 in lv_conf.h*/
static void ex_disp_fill(int32_t x1, int32_t y1, int32_t x2, int32_t y2,  lv_color_t color)
{
	 Trace(3,"ex_disp_fill %d,%d %d,%d",x1,y1,x2,y2);
    /*The most simple case (but also the slowest) to put all pixels to the screen one-by-one*/

      for(uint16_t y = y1; y <= y2; y++) {
        for(uint16_t x = x1; x <= x2; x++) {
        oled_buffer[((y*240)+x)]=(color.full)>>8;
		oled_buffer[(((y*240)+x))+1]=color.full;
           
			 
        }
    }
	
	
	
	
	 
  scan();
}

/* Write a pixel array (called 'map') to the a specific area on the display
 * This function is required only when LV_VDB_SIZE == 0 in lv_conf.h*/
static void ex_disp_map(int32_t x1, int32_t y1, int32_t x2, int32_t y2, const lv_color_t * color_p)
{
	
	Trace(3,"ex_disp_map %d,%d %d,%d",x1,y1,x2,y2);
      for(uint16_t y = y1; y <= y2; y++) {
        for( uint16_t x = x1; x <= x2; x++) {
        oled_buffer[((y*240)+x)*2]=(color_p->full)>>8;
		oled_buffer[(((y*240)+x)*2)+1]=color_p->full;
             color_p++;
			 
        }
    }
	
	
	
	
	 
  scan();
}
 
 
